import { string } from "prop-types";

type Actions = { type: "default"};

interface initstate {
    collections: [];
    current: string;
    open: boolean;
}

const collectionsReducer = (state: initstate , action:Actions) => {
    switch(action.type) {
        default:
            return state
    }
}

export default collectionsReducer
